import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class ProdCat extends Component {
    static propTypes = {
        prop: PropTypes
    }
    
    render() {
        return (
            <div>
               <p>Hrllo{this.props.locastate.cat}</p>            
            </div>
        )
    }
}
